import { useState } from 'react'
import NFLPlayers from './components/NFLPlayers'

const App = () => {
  const [nflPlayers] = useState([
    {
      Player: "Joe Banyard",
      eam: "JAX",
      pos: "RB",
      att: 2
    },
    {
      player :"Shaun Hill",
      team : "MIN",
      pos : "QB",
      att : 5
    }
  ])

  return (
    <div className='container'>
      {nflPlayers.length > 0 ? (
        <NFLPlayers nflPlayers={nflPlayers} />
      ) : ( 'No NFL Players' )}
    </div>
  )
}

export default App
